import {
  AppBar,
  ButtonGroup,
  Container,
  Grid,
  Toolbar,
  Typography,
} from "@mui/material";
import React from "react";
import logo from "../../Logo.svg";
import StyledButton from "../StyledComponents/StyledButton";

const LayoutAppBar = () => {
  return (
    <Container maxWidth="lg">
      <AppBar>
        <Toolbar>
          <Grid container rowSpacing={3}>
            <Grid item xs={3}>
              <img src={logo} alt={<Typography>Nexcent</Typography>} />
            </Grid>
            <Grid item xs={6}>
              <img src={logo} alt={<Typography>Nexcent</Typography>} />
            </Grid>
            <Grid item xs={2}>
              <ButtonGroup>
                <StyledButton label={"Login"} />
                <StyledButton variant="contained">Signup</StyledButton>
              </ButtonGroup>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </Container>
  );
};

export default LayoutAppBar;
